DROP TABLE IF EXISTS `soaa_reg_check`;
SET @saved_cs_client     = @@character_set_client;
SET character_set_client = utf8;
CREATE TABLE `soaa_reg_check` (
  `reg_no` varchar(10) NOT NULL,
  `reg_date` varchar(10) default NULL,
  `c_ceo_nm` varchar(10) default NULL,
  `c_biz_no` varchar(10) default NULL,
  `c_corp_nm` varchar(50) default NULL,
  `c_jibun1` varchar(3) default NULL,
  `c_jibun2` varchar(3) default NULL,
  `c_addr` varchar(100) default NULL,
  `c_tel` varchar(13) default NULL,
  `outdoor_act_cate` varchar(15) default NULL,
  `outdoor_act_type` varchar(8) default NULL,
  `outdoor_real_jibun1` varchar(3) default NULL,
  `outdoor_real_jibun2` varchar(3) default NULL,
  `outdoor_real_addr` varchar(100) default NULL,
  `gu_office` varchar(15) default NULL,
  `outdoor_size0` varchar(5) default NULL,
  `outdoor_size1` varchar(5) default NULL,
  `outdoor_size2` varchar(5) default NULL,
  `outdoor_size3` varchar(5) default NULL,
  `outdoor_size4` varchar(5) default NULL,
  `outdoor_size5` varchar(5) default NULL,
  `outdoor_size6` varchar(5) default NULL,
  `outdoor_size7` varchar(5) default NULL,
  `chk_personA` varchar(15) default NULL,
  `chk_personB` varchar(15) default NULL,
  `chk_result` varchar(11) default NULL,
  `chk_pay` int(11) default NULL,
  `payment_state` varchar(2) default NULL,
  `real_chkday` varchar(10) default NULL,
  `payment_in_day` varchar(10) default NULL,
  `report_certi` char(1) default 'N',
  `s_ceo_nm` varchar(10) default NULL,
  `s_biz_no` varchar(10) default NULL,
  `s_corp_nm` varchar(15) default NULL,
  `s_jibun1` varchar(3) default NULL,
  `s_jibun2` varchar(3) default NULL,
  `s_addr` varchar(100) default NULL,
  `use_item` varchar(10) default NULL,
  `outdoor_act_type_gubun` char(1) default NULL,
  `chk_report` text,
  `memo1` text,
  `chk_p_positionA` varchar(7) default NULL,
  `chk_p_positionB` varchar(7) default NULL,
  `rf_date` varchar(10) default NULL,
  `rf_nm` varchar(10) default NULL,
  `rf_payment` int(11) default NULL,
  `rf_reason` text character set latin1,
  `insert_id` varchar(15) default NULL,
  `insert_date` datetime default NULL,
  PRIMARY KEY  (`reg_no`)
) ENGINE=MyISAM DEFAULT CHARSET=utf8;
